Last month VS announced that it won't be airing its annual Angels fashion show, just a year after their chief marketing officer came out saying that they don't include fat or trans angels because they don't "sell the fantasy". So we decided to prove once and for all that fat girls, chubby girls, trans girls, dark skin girls, and disabled girls can sell the fucking fantasy all day long and if you won't represent us? We'll represent ourselves. Take a look at the power of everything you've been missing, because we're not going anywhere.

