The friendliest of reminders that it's always a good time to check in with whether you're only getting your body politics, feminism & social justice from the most palatable people (myself included). Every platform I'm given is because I don't fall too far outside the boundaries of what our culture sees as acceptable - in the way I look, the way I speak and the way I exist in the world. The fact that you're all here is included in that, and I wanna encourage you to go further. I think a lot of us need the more palatable people as an accessible entry point when we first start out (I know I did), but we can't stop there - those people are stepping stones, not the entire movement.

Take a look at who you're learning from, ask yourself why the information is easier to accept when it's coming from those voices, and challenge yourself to go further. There is always always more, and there are so many people deserving of way more recognition than they currently get. I've tagged & listed a few people below who I've learned a LOT from and if you're following anyone else who you think deserves more recognition, leave their @ in the comments! üíúüíôüíöüåàüåû @themilitantbaker
